import { Route, Routes } from 'react-router-dom'
import { Box } from '@mui/material'

import Homepage from './pages/Homepage';

function App() {
  return (
    <Box>
      <Routes>
        <Route exact path='/' element={<Homepage />} />
      </Routes>
    </Box>
  );
}

export default App;
